import BookingModal from './components/BookingModal';
import Service from './components/Service';

import React, {useState, Fragment} from "react";

function App() {
  return (
    <Fragment>
    <div className="row">
      <Service/>
      <Service/>
    </div>
    <div className="row">
      <BookingModal/>
    </div>
  </Fragment>
  );
}

export default App;
